import React from "react";
import CountdownTimer from "react-component-countdown-timer";

export default class Timer extends React.Component {
  constructor(props) {
    super(props);
      this.state = {
        time: 0 
    };
  }
  render() {
    return (
      <div>
        <h5>Timer</h5>
        {this.state.hours}
        {this.state.minutes}
        {this.state.seconds}

        <button
          type="button"
          className="btn btn-outline-dark waves-effect"
        >
          Start Timer
        </button>
      </div>
    );
  }
}
